const stylee = ({ ID }) => {
  function styleee() {
    if (ID === 3) {
      return {
        color: "#FFF",
        textAlign: "center",
        fontFamily: "Poppins",
        fontSize: "16px",
        fontStyle: "normal",
        fontWeight: "500",
        lineHeight: "32px",
      };
    }
  }

  return styleee;
};

export default stylee;
